According to the present invention there is provided a kit of cosmetic compositions, the kit comprising: 
1) a cleansing composition, the cleansing composition comprising: (i) a cosmetically acceptable carrier; (ii) one or more surfactants; (iii) one or more anti-inflammatory agent; (iv) one or more antioxidant agent selected from polyphenolic antioxidant agents and antioxidant vitamins; (v) one or more skin-soothing agent; 
2) a skin balancing composition, the skin balancing composition comprising: (i) a cosmetically acceptable carrier; (ii)  Ophiopogon japonicas  extract; (iii) one or more antioxidant agent selected from polyphenolic antioxidant agents and antioxidant vitamins; (iv) one or more sebum control agent selected from  Rosa canina  extract and sphingosine compounds; 
3) a daytime protective composition, the daytime protective composition comprising: (i) a cosmetically acceptable carrier; (ii) one or more UV-filter; (iii) one or more antioxidant agent selected from polyphenolic antioxidant agents and antioxidant vitamins; (iv) one or more skin-soothing agent; and 
4) an overnight treatment composition, the overnight treatment composition comprising: (i) a cosmetically acceptable carrier; (ii) one or more polyphenolic antioxidant agent; (iii) one or more antioxidant vitamin; (iv) one or more skin-soothing agent.

