An apparatus for transferring a transfer material (22) from a transfer component (24) to an article (10, 210, 220), the apparatus comprising: 
an array (38) of cavities (42), wherein each cavity of the array of cavities comprises: 
a frame (80), wherein the frame comprises a front face (82) having a first side portion (83), a second side portion (84) opposite the first side portion, an upper portion (85), and a lower portion (86) opposite the upper portion and a frame body (88) joined to the front face; 
a chamber (89) defined by the frame body, wherein the front face substantially surrounds an opening (87) to the chamber; 
a sealing portion (120) extending about at least a portion of the front face and adjacent to the opening; 
a vacuum portion comprising one or more conduits (104) in fluid communication with the chamber; and 
a first support member (140) disposed within the opening, wherein the support member is adjacent to the front face, wherein the first support member is configured to move in a first direction and a second direction opposite the first direction.

An apparatus for transferring a transfer material (22) from a transfer component (24) to an article (10, 210, 220), the apparatus comprising: 
an array (38) of cavities (42), wherein each cavity of the array of cavities comprises: 
a frame (80), wherein the frame comprises a front face (82) having a first side portion (83), a second side portion (84) opposite the first side portion, an upper portion (85), and a lower portion (86) opposite the upper portion and a frame body (88) joined to the front face; 
a chamber (89) defined by the frame body, wherein the front face substantially surrounds an opening to the chamber; 
a sealing portion (120) extending about at least a portion of the front face and adjacent to the opening; 
a clamp (76) disposed within the cavity; and 
a first support member (140) disposed within the opening, wherein the first support member is adjacent to the front face, and wherein the first support member is configured to move in a first direction and a second direction opposite the first direction.

A method for transferring a transfer material (22) from a transfer component (24) to an article (10, 210, 220), the method comprising: 
traversing an array (38) of cavities (42) in a machine direction (MD), wherein each cavity of the array of cavities comprises a frame (80) defining an opening (87) and a chamber (89); 
transferring a first article (210) into a first cavity (242) of the array of cavities, wherein the first article comprises a first face (212) and a second face (214); 
operatively engaging a portion of the first article with a clamp (76); 
advancing a transfer component (24) in the machine direction, wherein the transfer component comprises a first transfer material; 
positioning the first article such that the first face is in facing relationship with the transfer component; 
sealing a supported portion of the transfer component to a perimeter of the frame, wherein an unsupported portion of the transfer component is disposed over the opening, and wherein the first transfer material is disposed over the opening in facing relationship with the first face of the first article; 
contacting the first face of the first article to the first transfer material; and 
transferring the first transfer material to the first face of the first article to form a first decorated face of the first article.

A method for transferring a transfer material (22) from a transfer component (24) to an article (10, 210, 220), the method comprising: 
traversing an array (38) of cavities (42) in a machine direction (MD), wherein each cavity of the array of cavities comprises a frame (80) defining an opening (87) and a chamber (89); 
transferring a first article (210) into a first cavity of the array of cavities, wherein the first article comprises a first face (212) and a second face (214); 
operatively engaging a portion of the first article with a clamp (76); 
advancing a transfer component (24) in the machine direction (MD), wherein the transfer component comprises a first transfer material (22); 
positioning the first article such that the first face is in facing relationship with the transfer component; 
sealing a supported portion of the transfer component to a perimeter of the frame, wherein an unsupported portion of the transfer component is disposed over the opening, and wherein the first transfer material is disposed over the opening in facing relationship with the first face of the first article; 
traversing the first article in a first direction and a second direction opposite the first direction; 
contacting the first face of the first article to the first transfer material; and 
transferring the first transfer material to the first face of the first article to form a first decorated face of the first article.
